## Question 1
::: {.callout}

What do I need to open a saved `TableReport`?

- [ ] A python console
- [ ] An internet browser
- [ ] A Jupyter notebook
:::


::: {.callout-tip collapse="true"}
### Solution
An internet browser is enough. 
:::


## Question 2
::: {.callout}

Consider this dataframe and TableReport, then answer the question. 

::: {#6e7b2408 .cell execution_count=1}
``` {.python .cell-code}
import pandas as pd
from skrub import TableReport

df = pd.DataFrame({
    'Name': ['Alice', 'Bob', 'Charlie', 'Diana', 'Eve'],
    'Age': [25, 30, 35, 40, 45],
    'City': ['New York', 'Los Angeles', 'Chicago', 'Houston', 'Phoenix'],
    'Salary': [70000, 80000, 90000, 100000, 110000],
    'Department': ['HR', 'Finance', 'IT', 'Marketing', 'Sales']
})

TableReport(df, max_plot_columns=5, max_association_columns=3)
```

